import React from "react";
import "../Main.css";
import logo from "../images/molloy-logo.png";
export default function Main() {
  return (
    <main className="main">
      <img
        src={logo}
        className="molloy-logo"
        alt="logo of molloy university"
      ></img>
      <h1>Textbook Exchange</h1>
      <h2>Helping students with their textbook game</h2>
    </main>
  );
}
